		public override void ModifyWorldGenTasks(List<GenPass> tasks, ref double totalWeight)
		{
			int ShiniesIndex = tasks.FindIndex(genpass => genpass.Name.Equals("Final Cleanup"));
			if (ShiniesIndex != -1)
			{
				tasks.Insert(ShiniesIndex + 1, new PassLegacy("The Core Of Chaos", delegate (GenerationProgress progress, GameConfiguration passConfig)
				{
					progress.Message = "正在生成混沌核心";
					GenerateTerrain();
				}));
			}
		}

		private void GenerateTerrain()
		{
			int x = (int)((Main.maxTilesX - TheCoreOfChaosArray.GetLength(0)) / 2);
			int y = Main.maxTilesY - TheCoreOfChaosArray.GetLength(1) - 300;
			Tile tile;
			Chest chest;
			for (int j = 0; j < TheCoreOfChaosArray.GetLength(1); j++) 
			{
				for (int i = 0; i < TheCoreOfChaosArray.GetLength(0); i++)
				{
					tile = Framing.GetTileSafely(i + x, j + y);
					if (tile.TileType == TileID.Containers) 
					{
						for (int chestIndex = 0; chestIndex < 1000; chestIndex++)
						{
							chest = Main.chest[chestIndex];
							if (chest != null && chest.x == i + x && chest.y == j + y)
							{
								for (int inventoryIndex = 0; inventoryIndex < 40; inventoryIndex++)
								{
									chest.item[inventoryIndex].type = ItemID.None;
								}
							}
						}
					}
					WorldGen.KillTile(i + x, j + y);
					WorldGen.KillWall(i + x, j + y);
					WorldGen.KillWire(i + x, j + y);
					WorldGen.KillWire2(i + x, j + y);
					WorldGen.KillWire3(i + x, j + y);
					WorldGen.KillWire4(i + x, j + y);
					WorldGen.KillActuator(i + x, j + y);
				}
			}
			for (int j = TheCoreOfChaosArray.GetLength(1) - 1; j >= 0; j--) 
			{
				for (int i = 0; i < TheCoreOfChaosArray.GetLength(0); i++) 
				{
					switch (TheCoreOfChaosArray[i, j])
					{
						case 0:
						{
							break;
						}
						case 1:
							WorldGen.PlaceTile(i + x, j + y, ModContent.TileType<缭乱砾岩Tile>());
							break;
						case 2:
							WorldGen.Place3x2(i + x, j + y, (ushort)ModContent.TileType<崩溃祭坛Tile>());
							break;
					}
					/*switch (_wellshapeWall[y, x])
					{
						case 1:
							tile.wall = WallID.RedBrick;
							break;
					}
					switch (_wellshapeWater[y, x])
					{
						case 1:
							tile.liquid = 255;
							break;
					}*/
				}
				
			}

		}

		public override void SaveWorldData(TagCompound tag)
        {
			tag["Portal"] = PortalList.Select(PortalTag.Save).ToList();
		}

        public override void LoadWorldData(TagCompound tag)
        {
			PortalList = new List<PortalTag>(tag.GetList<TagCompound>("Portal").Select(PortalTag.Load));
		}

        public override void OnWorldLoad()
        {
			PortalList.Clear();
		}

        public override void OnWorldUnload()
        {
			PortalList.Clear();
		}
    }
	/// <summary>
	/// 传送门标签
	/// </summary>
	public struct PortalTag
	{
		/// <summary>
		/// 传送门唯一id
		/// </summary>
		public int id;
		/// <summary>
		/// 传送门的x坐标，使用Tile坐标
		/// </summary>
		public int x;
		/// <summary>
		/// 传送门的y坐标，使用Tile坐标
		/// </summary>
		public int y;
		/// <summary>
		/// 传送门的名称
		/// </summary>
		public string portalName;

        public PortalTag(int id, int x, int y, string portalName)
        {
            this.id = id;
            this.x = x;
            this.y = y;
            this.portalName = portalName;
        }

        public static TagCompound Save(PortalTag p)
		{
			var tag = new TagCompound();
			tag.Set("id", p.id);
			tag.Set("x", p.x);
			tag.Set("y", p.y);
			tag.Set("portalName", p.portalName);
			return tag;
		}

		public static PortalTag Load(TagCompound tag)
		{
			PortalTag p = new PortalTag();
			p.id = tag.GetInt("id");
			p.x = tag.GetInt("x");
			p.y = tag.GetInt("y");
			p.portalName = tag.GetString("portalName");
			return p;
		}
	}
}
